import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card'
import './index.css'
import object from './Object'


ReactDOM.render(
  <>
  <hl className="heading-style">list of 5 netflix super seires</hl>
  <div className='org-div'>
   <Card 
   imgsrc={object[0].imgsrc}
   title={object[0].title}
   sname={object[0].sname}
   links={object[0].links}
   />
   <Card 
   imgsrc={object[1].imgsrc}
   title={object[1].title}
   sname={object[1].sname}
   links={object[1].links}
   />
   <Card 
   imgsrc={object[2].imgsrc}
   title={object[2].title}
   sname={object[2].sname}
   links={object[2].links}
   />
   <Card 
   imgsrc={object[3].imgsrc}
   title={object[3].title}
   sname={object[3].sname}
   links={object[3].links}
   />
   <Card 
   imgsrc={object[4].imgsrc}
   title={object[4].title}
   sname={object[4].sname}
   links={object[4].links}
   />
   </div>
   </>
  ,document.getElementById('root')
);
